### Describe the issue

I build a custom onnxruntime for Android.  When I do inference with onnxruntime, it runs about 4 seconds, and it only cost about one second with com.microsoft.onnxruntime:onnxruntime-android:latest.release(1.12.0)
Could you check the command? Thanks.

My build command:
```
build.bat --android --android_sdk_path D:\Android_SDK --android_ndk_path D:\Android_SDK\ndk\23.0.7599858 --android_abi arm64-v8a --android_api 30 --cmake_generator Ninja   --build_java --include_ops_by_config F:\required_operators.config  --enable_reduced_operator_type_support  --skip_tests --cmake_extra_defines onnxruntime_BUILD_UNIT_TESTS=OFF  --parallel --build_shared_lib --minimal_build extended --use_nnapi --skip_tests
```
Demo code:
