            OnnxTensor a = OnnxTensor.createTensor(ortEnv, input);
            inputMap.put("float_input", a);
            OrtSession.Result r = ortSession.run(inputMap);
            long[] labels = (long[])r.get(0).getValue();
            return (int)labels[0];
        }catch(Exception e){
            e.printStackTrace();
        }
        return -1;
    }
