### Describe the issue

CPU EP implementation of LayerNormalization Contrib Operator does not broadcast the Scale and Bias Tensor and it ends up [reading value outside of memory bound](https://github.com/microsoft/onnxruntime/blob/main/onnxruntime/contrib_ops/cpu/layer_norm.cc#L119-L125). Unfortunately there is no unit test case present in [layer_norm_op_test.cc](https://github.com/microsoft/onnxruntime/blob/main/onnxruntime/test/contrib_ops/layer_norm_op_test.cc) which requires Scale and Bias Tensor to be broadcasted.

### To reproduce

Run below test case for LayerNormalization.

> TEST(LayerNormTest, LayerNorm_Scale_Bias) {
  OpTester test("LayerNormalization");
  test.AddAttribute<float>("epsilon", 1e-05f);
  std::vector<int64_t> dims{1, 3, 2};
  **test.AddAttribute("axis", 1);** 
  test.AddInput<float>("x", dims, {1.2416f, 0.946123f, 13.1685f, 0.36423f, 21.145f, 0.03941f});
  test.AddInput<float>("gamma", {2}, {-0.6953f, 5.1824f});
  test.AddInput<float>("bias", {2}, {0.6435f, -0.3964f});
  test.AddOutput<float>("output", dims, {0.420106f,  -3.31971f, -0.600539f, **-3.69086f, -1.28313f,  -3.89804f**}); // expected output
// actual output
// test.AddOutput<float>("output", dims, {0.420106f,  -3.31971f, -0.600539f, **1.42324e+18f, -3.68791e+18f,  -0f**});
  test.Run();
}

**Note:** 
- `axis` is 1, which says that gamma (Scale) Tensor needs to be broadcasted.
- Last 3 values are garbage in actual Output.

Command:
`onnxruntime_test_all.exe --gtest_filter=LayerNormTest.LayerNorm_Scale_Bias`

